import {React, useEffect, useState, useRef } from "react";


//styles
import {Style, BtnStyle} from './Form.styles'
import personimg from '../../images/person.png'


const Marker = ({children}) => children;

export default function PersonMarker(props) {

	const latitude = props.coordinates.latitude;
	const longitude = props.coordinates.longitude;
    console.log(latitude)
	return (
        <>
            key={1} 
            lat={latitude} 
            lng={longitude}	
            <BtnStyle>
                <button onClick= {() => {
                    <div>HEJ</div>
                    }}
                    className="crime-marker">
                    <img className = "scooter" src={personimg} alt="scooter"/>
                </button>
            </BtnStyle>
        </>
	);
}
